{"1": ["Соответствует описанию..", "2021-05-09T15:52:09Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "7": ["Заказывала 2,один пришёл повреждённый,но не так страшно,его вернула а другой конечно же оставила,очень понравился!)", "2021-05-04T06:52:04Z", "бежевый", "0", 1, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "8": ["Заказала 2 контейнера....один из них на следующий день приехал на пункт выдачи...думаю подозрительно как то быстро....оказался сломан....ну и наглость...и вы наивно полагаете что однажды за ним прийдет «слепой»? ", "2021-05-02T16:26:25Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "21": ["Хороший контейнер, без  брака,  заказала два 12л., 7.6л.", "2021-04-25T06:36:03Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "27": ["Товар пришел с браком.\nСкол уголка и сломана крышка..\nВозврат!", "2021-04-18T07:10:12Z", "бежевый", "0", 1, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "41": ["Отличные контейнеры", "2021-04-06T11:39:57Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "42": ["На фото верхний. Отличный контейнер, брала за 328.                          Нижний почти такой же брала в ** год назад", "2021-04-05T16:19:29Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "45": ["Отличное качество! Удобный контейнер, все наклейки легко снимаются. Вместительный, хотя и на вид довольно компактный. Рекомендую. Планирую взять ещё маленький.", "2021-04-01T08:34:11Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "49": ["День добрый ! Работники склада вообще потеряли совесть , шлют заведомо бракованный товар , ещё и маркировка возврат . УЖАС !!!", "2021-03-27T13:26:02Z", "бежевый", "0", 1, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "50": ["Контейнер хороший, но пришёл с браком. Возврат. ", "2021-03-26T14:45:15Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "52": ["Отличный контейнер из плотного пластика! ", "2021-03-26T04:05:48Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "53": ["Прислали сломанной, крышку просто положили в пакет!!! Абсолютное не уважение к покупателю!!! ", "2021-03-25T18:12:00Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "56": ["Первый раз пришёл с трещиной. Пришлось перезаразить, второй пришёл хороший. Удобный контейнер.", "2021-03-23T21:23:44Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "57": ["Отличные контейнеры. Пришли в целостности, прочная пластмасса, вместительные, приятный цвет\n", "2021-03-22T20:07:06Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "63": ["Очень симпатичные, компактные контейнеры. Пластик качественный, запаха нет. Порадовала снимающаяся без следов клея этикетка)", "2021-03-20T15:42:16Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "65": ["Мне повезло, ящички пришли целые, красивые)) Так их ждала, как раз порядок на кухне взялась наводить, очень кстати пришли, за неделю. Ещё возьму парочку, удобные. Наконец-то всё чисто и аккуратно! Для перфекциониста радость))", "2021-03-19T15:15:10Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "66": ["Товар достойный", "2021-03-19T08:18:48Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "71": ["Отлично! Все пришло целое. Мне очень понравились контейнер. Рекомендую", "2021-03-16T16:35:23Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "76": ["Ящик очень хороший, компактнай. Пришел без царапин и сколов. Доставка очень быстрая. 3 дня. ", "2021-03-13T13:25:19Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "78": ["Пришел в целый без сколов и трещин, спасибо. Классная вещь. Буду брать ещё чуть позже.", "2021-03-11T16:55:34Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "90": ["Пришел лопнутый контейнер, возврат", "2021-03-04T16:52:52Z", "бежевый", "0", 0, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "91": ["Даже и не знаю, сколько звёзд поставить. Сам товар хороший, удобный и очень нужный. Сужу по полученным  контейнерам меньшего объёма. А именно этот, на 10л пришёл с разбитым дном. Мне даже на ПВЗ его и не дали,сказали перезаказать", "2021-03-03T18:51:44Z", "бежевый", "0", 1, 0, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "93": ["Из заказанных двух контейнеров один пришел разбитый. Если магазину не хочется заботиться об упаковке и нравится отбраковывать большую часть товара - его дело.\nВ целом контейнер хороший, хотя и из серии \"маловато будет\". То есть, на сайте визуально кажется, что он будет больше. Но для семьи из 1-2 человек в самый раз.\nХотелось бы, чтобы производитель сделал всю переднюю скошенную часть откидной для более удобной загрузки/выгрузки продуктов и решетчатой - для лучшей вентиляции. В данной же модели вентиляции почти нет.\nСоветую всем кто приобрел данную конструкцию выстелить дно толстым слоем газеты и покрыть слоем луковой шелухи, по углам разложить высохшие головки чеснока или стручкового перца и хранить сырье в сетках (пластиковых для овощей, как в супермаркетах) - это немного замедлит порчу хранимых овощей.", "2021-03-03T11:27:24Z", "бежевый", "0", 6, 0, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "105": ["Ждала этот контейнер, но мне не повезло - пришёл треснутый. Очень жаль.... В магазине у нас в городе пока не нашла похожий. Мне кажется, Вайлдбериз нужно что-то менять в перевозке таких изделий, столько контейнеров перевели, ужас.", "2021-02-28T08:08:34Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "109": ["ВСЁ ломать ", "2021-02-26T20:10:40Z", "бежевый", "0", 1, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "110": ["Компактно и удобно.", "2021-02-26T18:11:59Z", "бежевый", "0", 1, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "111": ["Все пришло в целости, товаром довольна)) овощи хранятся аккуратно и эстетично!)) очень довольна! Рекомендую!)", "2021-02-26T16:09:29Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "113": ["В пункте выдачи  девушка сказала, что товар пришёл с браком, даже не вынесла, не показала. (( ", "2021-02-23T18:05:19Z", "бежевый", "0", 0, 2, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "114": ["Контейнер, может, и неплохой, но пришёл просто в пакете, угол разбит, будьте внимательные при получении, иначе потом придётся возвращать через личный кабинет, тратить время", "2021-02-23T17:55:04Z", "бежевый", "0", 1, 1, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "115": ["Пришел целый, довольна приобретением", "2021-02-23T08:34:00Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "116": ["Прислали уже не единожды битый контейнер. Запечатан, все видно насквозь и все равно прислали!!!! Все углы битые и в середине дыра. В футбол играли что-ли??!!! Возмущению нет предела", "2021-02-22T12:47:46Z", "бежевый", "0", 7, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "117": ["Почему отправитель кладёт только в пакет??? Пришёл отколотый угол контейнера!!! И судя по отзывам я не первая кому не поаезло(((", "2021-02-21T16:11:46Z", "бежевый", "0", 2, 0, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "119": ["Классные, я оч бовольна", "2021-02-20T16:24:54Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "122": ["Контейнер пришёл со вздутой крышечкой. Отказ. Цена 302р. Точно такой же купила в Ленте по 199р. Фото прилагаю.", "2021-02-19T18:19:31Z", "бежевый", "0", 3, 1, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "125": ["Хорошие контейнеры, сложили туда картошку. Нравится нейтральный цвет. Все контейнеры и крышки были целые, заказывала сразу 3 штуки.", "2021-02-19T07:52:11Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "126": ["Треснутый контейнер.отказ.полное разочарование магазином.надеюсь,что деньги вернут", "2021-02-18T19:14:04Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "131": ["Интересно наши отзывы читают сотрудники  WB ?! Судя по всему нет. Заказала данный товар, пришел в расколотом виде, и я не первая кто получил такое. Наведите порядок в вашей организации и не тратьте деньги, время и терпения ваших покупателей. \nСам контейнер понравился и был бы очень удобен в использование, если бы был доставлен в целости и сохранности.", "2021-02-17T14:29:41Z", "бежевый", "0", 6, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "133": ["Сначала потеряли, потом прислали разбитый🤷🏼‍♀️ Мне даже подгузники приходят в картонной коробке, а хрупкий пластик почему-то в целофане🤦🏼‍♀️", "2021-02-17T11:38:27Z", "бежевый", "0", 2, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "135": ["Брала два контейнера на 7и 11 литров, большой контейнер пришел с битой крышкой, пришлось отказаться, купила в т.ц. о Кей за 260 рублей салатового цвета, жалко, что некоторые изделия приходят в плачевном состоянии, а так контейнеры очень удобные для хранения овощей.", "2021-02-17T00:36:48Z", "бежевый", "0", 4, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "136": ["Контейнер хороший. Брала два.Один под картошку другой под лук. Так вот для картошки супер удобно . А для лука не пойдёт, лук очень сильно проростает в нём, за счёт того что нет вентиляции.у меня все это стоит на балконе в шкафу,живу на юге.\nТак что имейте ввиду для чего берёте. \nА так ,конечно ,очень аккуратно все смотрится.Я люблю красиво и практично.", "2021-02-16T17:03:01Z", "бежевый", "0", 3, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "137": ["Пришёл разбитый в одном месте 👿", "2021-02-16T16:36:58Z", "бежевый", "0", 2, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "139": ["Контейнер пришёл разбитый в трёх  местах, а так хотелось контейнер для овощей.Читала что часто приходят разбитые, но  надеялась что повезёт, но увы...", "2021-02-15T05:45:57Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "142": ["Также, как и остальным, пришёл разбитый с выломанным дном", "2021-02-14T13:53:13Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "144": ["Крышка пришла треснутая. Взял 2 контейнера и на обоих крышечки белые сломанные не закрываются. Надо внимательнее осматривать товар при получении. Вайлберис следите за своей транспортировкой! ", "2021-02-14T08:00:01Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "145": ["Не удалось узнать насколько хорош контейнер, пришел разбитый в хлам) спасибо за потраченное время на ожидание кусочков пластика 🤗🤗 ", "2021-02-13T17:06:23Z", "бежевый", "0", 2, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "146": ["Ужасный контейнер   пришёл разбитый", "2021-02-13T16:56:23Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "147": ["Крайне тонкий пластик  в тандеме с крайне не  бережной доставкой, даёт многочисленные трещины, сколы и вмятины, нетоварный вид и неуважительное отношение к покупателю . Ставлю 2 звёзды за продуманную эргономику. Оставила, потому что тут всего лишь маленькая трещинка на крышке и вещь мне очень нужна. Заказала ещё два контейнера поменьше и оба пришли в непотребное виде, отказ - дверца отломана и куски пластика повсюду.", "2021-02-13T12:49:04Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "150": ["Контейнер понравился,хороший пластик. Но за 2 дня начался портится лук. Испарение жуткое. Вентиляция мало. Очень жаль", "2021-02-11T09:23:53Z", "бежевый", "0", 4, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "151": ["Контейнер понравился пришёл целый. Вместительный.", "2021-02-10T08:02:57Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "153": ["Контейнер соответствует описанию, пластик хороший, крышка хорошо закрывается. У меня возврат тк размер все таки для моей тумбы велик. Жаль тк и цена и качество понравились.", "2021-02-09T07:40:55Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "155": ["Заказала 2 контейнера 11.2 и 7.6 \nБез брака,покупкой довольно.", "2021-02-07T11:30:40Z", "бежевый", "0", 5, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "156": ["Оказался отколотый край, перезакажу, вдруг прийдет целый )", "2021-02-07T10:24:27Z", "бежевый", "0", 1, 0, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "164": ["Полностью сломан", "2021-02-04T17:53:30Z", "бежевый", "0", 0, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "166": ["заказала два, один пришёл бракованный, пришлось перезаказать, упакован только в пакет", "2021-02-04T06:35:46Z", "бежевый", "0", 1, 0, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "167": ["Сломана крышка", "2021-02-03T18:32:43Z", "бежевый", "0", 0, 1, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "169": ["Второй раз пришёл заказ с разбитой крышкой. Просьба изымать из оборота такие контейнеры. Очень жаль, что приходится тратить много времени на ожидание товара, а он бракованный. Надеюсь 3 раз будет удачнее. Сам товар отличный, маленький контейнер без нареканий.", "2021-02-02T10:05:32Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "170": ["Ящики от холодильника съедали много места. Были не удобные и в них портились овощи. Этот идеально подошёл под размеры и теперь у меня много картошки и морковки, которые не портятся и их удобно вынимать. ", "2021-02-02T08:39:12Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "171": ["Пришел без повреждений.Очень вместительный и эстетичный ящик.", "2021-02-01T18:51:35Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "176": ["Сломано крепление", "2021-01-30T18:01:33Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "179": ["Заказала контейнер, а он пришел разбитый. Отказ. До этого заказывала два и они пришли целые. Контейнеры удобные, но по объему маловаты. В один контейнер входит 2,5-3 кг картофеля (не сорта эконом). На семью из 3 человек приходится брать 3 шт. Храню там лук, картофель и свеклу.", "2021-01-30T07:12:32Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "180": ["Отличные контейнеры! Вместительные, очень удобные, продукты не преют! Теперь дети с радостью бегут за картошкой и луком 😊\nМне повезло, оба пришли целые.\nБольшое спасибо!", "2021-01-30T05:17:00Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "181": ["Контейнер хороший, но пришёл со сломанной крышкой... Очень обидно. Заказывала два, разного объема, второй в целости. Судя по отзывам, это очень частая проблема. Такое впечатление складывается, что у компании по доставке в штате есть сотрудник, который занимается мелким вредительством..... То ли по собственной инициативе, то ли по указанию свыше...... ", "2021-01-29T17:19:35Z", "бежевый", "0", 1, 0, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "182": ["Заказала три контейнера. Доставку разделили на две почему-то, в один день принесли один контейнер, второй пришёл сломанный, в другой вообще не принесли. Деньги вернули за один.\nНо, поскольку контейнеры мне всё-таки были нужны, заказала ещё три в пункт самовывоза. Один пришёл треснутый, сказали, что вернут. Отмечен как полученный.\nКороче, из шести заказанных у меня три штуки целых, при этом каждый по цене вдвое выше. \nДеньги вайлдберриз не возвращает.\nЕсли вам повезло и контейнер вдруг целый, то он ок, картошка в него помещается, контейнеры устойчиво стоят друг на друге", "2021-01-28T10:35:12Z", "бежевый", "0", 2, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "191": ["Пришел разбитый. Отказ. Буду заново заказывать. Столько отзывов, что приходит сломанный контейнер, и так никто и не пытается улучшить упаковку.", "2021-01-20T06:15:44Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "192": ["Пришёл с отбитыми краями! Но очень понравился буду перезаказывать", "2021-01-19T13:37:24Z", "бежевый", "0", 1, 0, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "193": ["Контейнер очень удобный, но пришел разбитый. Армированный скотч с двух сторон выручил.", "2021-01-19T13:32:57Z", "бежевый", "0", 0, 1, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "197": ["Почему то когда берешь много сунут г... О для чего?", "2021-01-15T11:52:01Z", "бежевый", "0", 0, 1, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "198": ["Хороший вместительный", "2021-01-15T07:29:14Z", "бежевый", "0", 1, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "199": ["Отличный,все целое", "2021-01-14T11:56:53Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "200": ["Этот контейнер ходит похоже по кругу.Никто его не выкупает,потому что бракованный. Безобразие творит WB!", "2020-11-26T14:41:24Z", "бежевый", "0", 5, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "202": ["Всё соответствует описанию. Взяла два- для лука и картофеля. Очень хорошо экономит пространство. ", "2021-01-13T17:17:37Z", "бежевый", "0", 3, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "203": ["Дополняю свой отзыв фото", "2021-01-13T17:20:09Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "209": ["Ооочень довольна 👍 спасибо! Пришли целыми, тоже очень порадовало.", "2021-01-10T16:11:29Z", "бежевый", "0", 4, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "214": ["Хорошие контейнеры. На крышке была не большая трещина, но все равно оставила", "2021-01-09T07:49:14Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "217": ["Начиталась отзывов и очень боялась что придёт повреждённый. Заказывала на 7.5 и 11.6 л. Оба пришли целые, без единой царапины. Не удивительно, что так много отзывов про трещины и сколы, ведь они приходят в одном прозрачном пакетике, сломать - раз плюнуть. Но мне повезло. Спасибо!", "2021-01-07T17:19:24Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "220": ["Отличный, влазиет ведро картошки)", "2021-01-06T12:37:02Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "225": ["Контейнер хороший. Сложила в него картошку. Очень удобно👍", "2021-01-05T13:16:40Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "228": ["оплатила пять контейнеров объемом 11,2л. Привезли два контейнера объемом 11,2л при этом у одного контейнера отбит угол. И три контейнера объемом 7,5 л.!  С возвратом проблемы. Отклонили запрос на возврат из-за отбитого угла!!! А с возвратом трех контейнеров по 7,5л вообще не понятно. ответа нет...", "2021-01-05T09:25:32Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "229": ["Заказывала 2 контейнера, оба пришли целые, без единой царапинки.\nЗаявленный объем немного смущает, на самом деле ведро картошки не поместится, от силы 3кг или 4кг.\nРаньше покупала такие контейнеры в Fix-price за 199р мятного цвета, а сейчас понадобились в бежевом цвете. По качеству такие же. Только цена 338р. \nК заказу рекомендую. Хорошие контейнеры, мобильные, не громоздкие, можно поставить друг на друга.", "2021-01-05T06:36:54Z", "бежевый", "0", 2, 2, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "230": ["Пришел треснут и разбит с отломанным куском ", "2021-01-04T14:50:26Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "231": ["Пришел со сколом на крышке, соответственно оформила возврат. При чем самого скола в пакете не было, значит, со склада уже такой товар отправлялся?", "2021-01-04T12:17:15Z", "бежевый", "0", 2, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "232": ["Принесла домой, и внизу увидела 2 трещины на 2 контейнерах!!!!", "2021-01-02T16:15:51Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "234": ["Шёл очень долго и пришёл треснутый со всех сторон.", "2020-12-31T12:14:28Z", "бежевый", "0", 2, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "235": ["Контейнер хороший,но пришёл на 7.6 л.,а заплатила как за 11.2л.", "2020-12-30T13:17:39Z", "бежевый", "0", 2, 1, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "236": ["Пришли два контейнера, оба целые. Качество порадовало!", "2020-12-30T13:10:05Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "237": ["Товар поврежден, пришел с трещиной, см.фото", "2020-12-28T17:42:18Z", "бежевый", "0", 2, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "239": ["Заказала три контейнера, два оставила, третий пришел со столом. \nВ быту очень удобные. Советую к приобретению", "2020-12-26T12:46:19Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "240": ["Отличный контейнер! Проверяйте на сколы. Заказывала 2 шт, один был сломан!", "2020-12-24T20:46:56Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "242": ["Заказала 2 контейнера но оба пришли   Браком!на 1 дно разбито на 2 крышка сломана!видела отзывы но думала а вдруг повезёт!чудо не свершилось(((", "2020-12-23T10:08:53Z", "бежевый", "0", 2, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "244": ["Пришел разбитый. Возврат", "2020-12-22T15:23:23Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "246": ["Аккуратно мне очень понравилось", "2020-12-21T05:02:01Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "249": ["Ужасно, заказала 2 контейнера -и оба были в сколах и трещинах, столько времени ждала и такая подстава, в последнее время часто приходят бракованные товары", "2020-12-15T06:03:42Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "251": ["Отличные контейнеры для овощей.  Взяла 2шт для лука и картофеля.  Пришли целые. Доставка вовремя.  Уже всё сложила. Объем для меня идеальный.  Спасибо.", "2020-12-13T09:43:40Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "253": ["Где крышка от контейнера ? Ужа контейнер вес поцарапан", "2020-12-10T20:45:32Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "257": ["Заказыаю второй раз. Приходит треснутый", "2020-12-08T06:28:08Z", "бежевый", "0", 1, 0, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "259": ["Пришёл треснутый((( ", "2020-12-02T18:55:18Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "261": ["Пришел с большой дырой", "2020-12-02T08:38:17Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "262": ["Пришёл битый уже второй раз! Упаковывайте хотя бы в пупырчатую пленку. ", "2020-12-01T17:16:10Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "264": ["Очень удобно и смотрится отлично! Вместительные, купила сразу два!", "2020-11-30T19:03:45Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "268": ["Ооо.... Самый полезный продукт, которые когда либо я заказывала на вайлб😃очень понравилась", "2020-11-28T16:05:51Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "272": ["Контейнер классный.очень вместительный и смотрится аккуратно.хорошее качество  пластика.все пришло целое.", "2020-11-22T20:27:06Z", "бежевый", "0", 3, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "273": ["Пластик отличный, ящик целый, но отломан зубчик на крышке", "2020-11-22T12:15:28Z", "бежевый", "0", 0, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "277": ["Удобная вещь. Без брака.", "2020-11-11T13:52:07Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "279": ["Пришел весь потресканный, не выкупила", "2020-11-20T11:29:22Z", "бежевый", "0", 3, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "280": ["Пришел без куска угла...в пакете его не было, значит так и упаковали не обращая внимание на брак! Или специально!", "2020-10-30T06:29:47Z", "бежевый", "0", 4, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "282": ["Заказываю второй раз. При первой доставке  один контейнер из двух пришел с трещиной. Второй раз заказывала, получал внук , на одном брак разглядел, на втором не увидел . И куда теперь с этим треснутым контейнером? Почему же отправляется не качественный товар?", "2020-11-18T10:25:56Z", "бежевый", "0", 3, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "283": ["Товар пришел с браком, пришлось отказаться, к сожалению сфоткать не смогла, малыш не дал.", "2020-11-13T06:55:38Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "287": ["Пришел со сломанной крышкой .Оставила из за лени возвращать туда сюда ездить .\nТакое ощущение что на это и \nрасчитано .Пока не попадет в нужные руки.Так контейнер хорошенький.", "2020-11-16T09:07:12Z", "бежевый", "0", 1, 1, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "288": ["Очень классная штучка,буду брать еще", "2020-11-16T06:43:08Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "289": ["Ужас, разбитый, такое чувство что не первая получаю этот разбитый контейнер, т.к. упаковка просто запихана в него, для чего это делают не понятно", "2020-11-15T13:40:08Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "296": ["Всё пришло целое. Теперь эстетичный вид!) Спасибо.", "2020-11-10T19:40:25Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "311": ["Пришёл контейнер с отколотой крышкой. Зачем отправлять товар заведомо обречённый на возврат. Безобразие.", "2020-10-29T13:53:42Z", "бежевый", "0", 3, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "315": ["Из четырех заказанных контейнеров только 2 пришли целыми...Но это минус не производителю, а службе доставки. Контейнеры удобные в использовании👍", "2020-11-03T13:03:42Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "316": ["Контейнер пришёл с браком, очень жаль. Сломано крепление на крышке", "2020-11-02T07:26:54Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "319": ["Класс!!! Мне пришел целый!!! Ура.\nКлассный ящик, экономит место и все красиво теперь.", "2020-10-31T18:46:45Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "321": ["Пришёл со сломанной крышкой и треснутым дном", "2020-10-31T14:22:54Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "322": ["Контейнер очень понравился! Заказывала сразу 2 штуки, пришли целые не разбитые! Спасибо W за доставку!", "2020-10-30T10:53:04Z", "бежевый", "0", 1, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "324": ["Классные контейнеры", "2020-10-31T09:26:39Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "327": ["Дно треснуто, проверяйте товар на месте обязательно...", "2020-10-30T13:01:17Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "328": ["Спасибо большое,  все классно!!! Обидно только заказала 2 большой и маленький  контейнер, пришли быстро, но  аленький без крышки, где потеряли?\nНе взяла, перезакажу снова, прошу не снижать % покупки, это же не моя вина..\n\nА в целом очень довольна  сотрудничеством с WB, я уже и в магазины почти не хожу.", "2020-10-30T07:19:06Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "333": ["Заказала контейнер пришёл разбитый", "2020-10-27T14:52:36Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "336": ["Контейнер отличный, но как оказалось во многих отзывах, заказала два-один разбит.", "2020-10-26T14:26:20Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "343": [" Возврат,заказывала два контейнера,оба пришли сломанные ", "2020-10-20T10:31:41Z", "бежевый", "0", 0, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "347": ["Это лучшее что я могла найти...хранить под раковиной овощи стало проще и симпотнее...", "2020-10-16T18:46:29Z", "бежевый", "0", 4, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "348": ["Второй раз заказала алилуя целый😀", "2020-10-16T04:07:11Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "352": ["Контейнеры пришли отличные, ну поломаны, без сколов и трещин, вместительные, даже не ожидала, что они таких размеров, вообщем я довольна! Единственное, изначально думала, что они становятся как пазл один в один, а оказалось нет, но ничего, я поставила друг на друга)", "2020-10-14T10:28:57Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "353": ["Хорошие 👌 без брака", "2020-10-12T12:34:32Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "354": ["Пришёл сломанный контейнер. Отколот кусок крышки. Муж забирал, не заметил..... теперь пользуюсь сломаным ", "2020-10-12T08:14:24Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "358": ["Хороший контейнер,но возврат по причине трещин на крышке,прошу не учитывать %выкупа,буду перезаказывать", "2020-10-07T02:47:47Z", "бежевый", "0", 0, 1, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "360": ["Один пришёл отличный ни одного скола, второй был полностью в дребезги, девушка которая выдавала сразу сказала возврат. Как можно так упаковывать? Точнее как так никак можно упаковывать? Придумайте твёрдую упаковку, чтобы приходили целые, а они просто в полиэтилен сейчас упакованы. Очень хрупкие же. Буду заказывать ещё один, надеюсь придёт целый. ", "2020-10-06T08:58:51Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "365": ["Товар пришел без повреждений, заказала 3шт, в одном ящике немного, но не критично, деформирована откидная крашка ( белая с отвеостиями). Ящики удобные, входит около 5 кг картофеля. Хорошо устанавливаются друг на друга. Материал средней толщины и, по ощущению - хрупковатый, посмотрим, как долго прослужит. За такую цену, можно взять.", "2020-10-05T08:04:36Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "369": ["Заказала два ,забрала домой и не обратила внимание что один пришёл с дыркой :( очень не приятно (заклеила,но теперь радости от покупки увы нет)", "2020-09-29T15:39:41Z", "бежевый", "0", 1, 0, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "370": ["Начиталась отзывов,  заказала два сразу,  один думаю в любом случае будет поломан,  но как закон подлости,  все целое. Контейнеры очень хорошие, сложила овощи, сижу и любуюсь.", "2020-09-28T10:46:55Z", "бежевый", "0", 3, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "374": ["Контейнер битый. Ужасное отношение к клиентам. Зачем же  испорченный товар отправлять? Оставила, так как муж забирал и не обратил внимание.", "2020-09-23T12:09:54Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "376": ["Битый контейнер.", "2020-09-22T14:15:40Z", "бежевый", "0", 0, 1, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "378": ["Отличный контейнер! Пришёл целый)закажу ещё пару", "2020-09-21T07:49:57Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "379": [" Контейнер понравился ,быстро доставили ничего не скажу, а вот состояние самих контейнеров ожидает желать лучшего ((расстроена ,сделан возврат ", "2020-09-21T07:46:12Z", "бежевый", "0", 2, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "380": ["Пришел без трещин, удобный, полезная вещь", "2020-09-20T13:52:46Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "386": ["Контейнер пришёл целый без сарапины, очень классный", "2020-09-18T15:40:34Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "387": ["Мне коробочки пришли без брака, на день раньше срока. Очень довольна!", "2020-09-18T06:35:16Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "388": ["Вместо контейнера пришла гладильная доска. Как так возможно не понимаю🤷‍♀️", "2020-09-15T16:59:18Z", "бежевый", "0", 3, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "389": ["понравились контейнеры. но! первый раз заказала 2 контейнера - один пришел со сломанной крышкой, перезаказала. второй раз торопилась и тщательно не проверила в пункте выдачи, на первый взгляд контейнер был целый и крышка на месте, а дома при распаковке обнаружила отломанный угол и этикетку на пакете \"возвратная\". неприятно. что за сервис? почему вы брак перекидываете от клиента клиенту? и если они  хрупкие, может имеет смысл хотя бы в картоне отправлять, а не в пакете?", "2020-09-15T11:55:01Z", "бежевый", "0", 1, 0, 3, "Контейнер для овощей 11,2л", "Полимербыт"], "391": ["Где мой деньги ? С 1 сентября жду уже 12 сентября деньги списались и сразу отмена ни товара ни денег 🤬", "2020-09-12T03:59:10Z", "бежевый", "0", 3, 1, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "393": ["Контейнеры хорошие. Целым приходит примерно один из пяти, уже оформил два возврата, сейчас жду следующий контейнер.)", "2020-09-09T12:15:27Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "394": ["Мало того что ожидала посылку дольше чем было написано,так ещё и прислали сломанный!!!В пункте выдачи этого не заметила сразу!", "2020-09-09T08:58:17Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "395": ["Заказывала 2 контейнера, один пришёл в браком. Возврат", "2020-09-08T08:56:10Z", "бежевый", "0", 1, 0, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "397": ["Конечно в фикспрайсе они стоили дешевле на 100 руб, но там я не успела их купить. Хорошие контейнеры, пришли без трещин, хотя очень боялась на такие наткнуться после отзывов, рекомендую", "2020-09-04T20:44:59Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "399": ["Ящички пришли целые, в хорошем состоянии. Визуально очень приятные, аппетитные)) и качество вполне хорошее", "2020-09-04T13:09:00Z", "бежевый", "0", 2, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "401": ["Я ранее писала, что привезли только один из двух заказных ящиков. Деньги вернули, а ящик стал дороже на 10₽ 😀. Перезаказала второй (спасибо за бесплатную доставку заказа за 298₽). Пришёл целым, без брака, трещин. Крышечки окошек работают исправно на обоих контейнерах. Теперь комплект (голубой ящик был изначально). Миссия выполнена!))", "2020-09-04T05:44:26Z", "бежевый", "0", 1, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "406": ["Купила 2 контейнера, при получении торопилась и не проверила. В итоге один целый, угол на дне второго разбит. Раньше при заказах все было отлично, конечно, расстроилась.", "2020-08-31T09:39:13Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "411": ["Контейнер сам по себе, классный, хорошего объёма,  не громоздкий, но вместительный, но упаковка отвратительная, в результате - трещина на дне.  Возрат", "2020-08-19T19:42:33Z", "бежевый", "0", 1, 0, 4, "Контейнер для овощей 11,2л", "Полимербыт"], "413": ["Отзыв называется \"Найди 10 отличий\". Один контейнер я заказала на валберес за 300 рублей, второй купила в фикспрайсе за 200 рублей. А так контейнер классный, отлично вписался ко мне в мойку", "2020-08-25T13:29:26Z", "бежевый", "0", 7, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "414": ["Возврат, т.к. в *** такой контейнер стоит *** руб. Точь в точь такой же.", "2020-08-24T20:21:12Z", "бежевый", "0", 5, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "415": ["Товар пришёл с браком-треснута крышка(", "2020-08-24T10:33:05Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "416": ["Очень понравились! Пришли целые, объем то что надо!", "2020-08-24T03:39:04Z", "бежевый", "0", 4, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "417": ["Заказала 2 шт. Один целый, второй с отколотой крышкой.  Сделала повторный заказ. Пришел с огромной трещиной на дне. ", "2020-08-23T18:10:25Z", "бежевый", "0", 1, 0, 2, "Контейнер для овощей 11,2л", "Полимербыт"], "418": ["Контейнер пришёл с поломанной крышкой 😏 почему нельзя в коробку упаковать???", "2020-08-23T12:57:35Z", "бежевый", "0", 1, 0, 1, "Контейнер для овощей 11,2л", "Полимербыт"], "419": ["Отличные вместительные контейнеры, но купив здесь, увидела в фикспрайсе такие же в 2 раза дешевле ", "2020-08-21T20:22:17Z", "бежевый", "0", 3, 0, 5, "Контейнер для овощей 11,2л", "Полимербыт"], "422": ["Товар отличный. Для картошки, лука, ни много ни мало, хороший объем. У меня, к сожалению, место под раковиной не позволяет ставить друг на друга, поставила рядом, тоже все аккуратн